import React from 'react'
import { HomeButton } from './HomeButton'
import { useSelector, useDispatch } from 'react-redux'
import { add } from '../actions'
import { connect } from 'react-redux'
import { getCities } from '../actions/citiesAction'
import PropTypes from 'prop-types'



class LogIn extends React.Component {
    componentDidMount() {
        this.props.getCities();

    }

    render() {
        const counter = useSelector(state => state.counter);
        const dispatch = useDispatch()
        const { items } = this.props.item

        return (
            <div className="app">
                <div className="header-container">
                    <p className="itinerarydescription">LogIn to your account</p>
                </div>
                <p>Counter {counter}</p>
                <button onClick={() => dispatch(add())}>+</button>
                <button>-</button>

                <div className="mid-container" >
                    <p className="itinerarydescription" >Enter mail and password</p>
                </div>



                {items.name}


                <div className="footer-container">
                    <p className="itinerarydescription">LogIn</p>

                    <HomeButton />

                </div>
            </div>
        )
    }
}

LogIn.propTypes = {
    getCities: PropTypes.func.isRequired,
    items: PropTypes.object.isRequired

}
const mapStateToProps = (state) => ({
    items: state.item
})
export default connect(mapStateToProps, { getCities })(LogIn);
